import React, { Component } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Dataset from "./Dataset";

class Datasets extends Component {



    render() {
        const {datasetListJSON} = this.props

        const numberOfDataset = datasetListJSON.length
        const datasetElements = [];
        for (let i = 0; i < numberOfDataset; i++) {
            datasetElements.push(
                <Dataset key={i}
                         datasetSequence={i}
                         datasetOriginalJSON={datasetListJSON[i]}
                         handleSendRequest={this.handleSendRequest}
                />
            );
        }


        return (
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Dataset Name</TableCell>
                            <TableCell align="right">Status</TableCell>
                            <TableCell align="right">Bounding Name</TableCell>
                            <TableCell align="right">Setting</TableCell>
                        </TableRow>
                    </TableHead>

                    <TableBody>
                        {datasetElements}
                        {/*{this.rows.map((row) => (*/}
                        {/*    <TableRow*/}
                        {/*        key={row.name}*/}
                        {/*        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}*/}
                        {/*    >*/}
                        {/*        <TableCell component="th" scope="row">*/}
                        {/*            {row.name}*/}
                        {/*        </TableCell>*/}
                        {/*        <TableCell align="right">{row.calories}</TableCell>*/}
                        {/*        <TableCell align="right">{row.fat}</TableCell>*/}
                        {/*    </TableRow>*/}
                        {/*))}*/}
                    </TableBody>
                </Table>
            </TableContainer>
        );
    }
}

export default Datasets;
